// import logo from './logo.svg';
import './home.css';
import React from 'react'

class Home extends React.Component {
    render() {
        var names = ['asdf', 'asdf', 'asdf'];
        return (
                <div id="background">
                    <div id="title">Indicium</div>
                    <ul>
                        {names.map(function(index, name) {
                            return <li key={index}>{name}</li>
                        })
                        }
                    </ul>

                </div>
        )
    }
}

export default Home;
